import React from "react";
import {
  AboContainer,
  Abowrapper,
  AboRow,
  Column1,
  TextWrapper,
  Heading,
  Subtitle,
  TopLine,
} from "./AboutElements";
import { Button } from "react-scroll";

export const AboutSection = () => {
  return (
    <>
      <AboContainer>
        <Abowrapper>
          <AboRow>
            <Column1>
              <TextWrapper>
                <TopLine>TopLine</TopLine>
                <Heading lightText="true">Heading</Heading>
                <Subtitle>Subtitle</Subtitle>
                <BtnWrap>
                  <Button to="home">buttun</Button>
                </BtnWrap>
              </TextWrapper>
            </Column1>
          </AboRow>
        </Abowrapper>
      </AboContainer>
    </>
  );
};
